import React from "react";
import { useParams } from "react-router-dom";

const Ordered = () => {
  const { id } = useParams();

  return (
    <div className="container">
      <img
        src="https://cdn.paycom.uz/documentation_assets/power-by-Payme.svg"
        alt="payme"
        width={400}
      />
    </div>
  );
};

export default Ordered;
